import React from "react";
import ReactDOM from "react-dom/client";
import "./app1212.css";
import { BrowserRouter } from "react-router";
import CardApp1210 from "./CardApp1210";
import authLogic1212 from "./service1212/authLogic1212";
import { app } from "./service1212/firebase1212";
import image_upload1212 from "./service1212/image_upload1212";
import ImageFileInput1212 from "./components1210/common1210/ImageFileInput1212";
import CardLogic1216 from "./service1212/cardLogic1216";

// 로그인 객체르 왜 여기서 생성하나요?
// 리액트는 상위태그에서 하위태그로만 프롭스를 넘길 수 있다.
const authLogic = new AuthLogic1212(app);
const cardLogic = new CardLogic1216(app);
// firebase ReaItime Database를 활용하기 위해서 공통코드 생성하기
const imageUploader = new image_upload1212();

const FlieInput = (props) => {
  <ImageFileInput1212 {...props} imageUploader={imageUploader} />;
};

const root = ReactDOM.createRoot(document.querySelector("#root"));
root.render(
  <>
    <BrowserRouter>
      {/* 리액트에서 사용자정의 태그는 일급함수이다 */}
      <CardApp1210
        FileInput={FlieInput}
        authLogic={authLogic}
        cardLogic={cardLogic}
      />
    </BrowserRouter>
  </>
);
